const App = () => {
  const [prompt, setPrompt] = useState("");
  const [requestId, setRequestId] = useState(null);
  const [txHash, setTxHash] = useState("");
  const [tokenURI, setTokenURI] = useState("");
  const [imageSrc, setImageSrc] = useState("");

  const handlePromptChange = (e) => setPrompt(e.target.value);

  const requestAIResult = async () => {
    if (!window.ethereum) {
      alert("Metamask is required");
      return;
    }

    const web3 = new Web3(window.ethereum);
    const contract = new web3.eth.Contract(ABI_PROMPT, CONTRACT_ADDRESS_PROMPT);
    const accounts = await window.ethereum.request({ method: "eth_requestAccounts" });
    const from = accounts[0];

    try {
      const gasEstimate = await contract.methods.estimateFee(MODEL_ID).call();
      const tx = await contract.methods.calculateAIResult(MODEL_ID, `prompt no line format one tagline about: ${prompt}`)
        .send({ from, value: gasEstimate });

      const event = tx.events.PromptRequest;
      if (event) {
        const reqId = event.returnValues.requestId;
        setRequestId(reqId);
        alert(`Request ID: ${reqId} submitted`);
      }
    } catch (error) {
      console.error("Error requesting AI result:", error);
    }
  };

  const mintNFT = async () => {
    if (!requestId) {
      alert("No valid request ID found");
      return;
    }

    const web3 = new Web3(window.ethereum);
    const contract = new web3.eth.Contract(ABI_PROMPT, CONTRACT_ADDRESS_PROMPT);
    const accounts = await window.ethereum.request({ method: "eth_requestAccounts" });

    try {
      const tx = await contract.methods.mintWithAIResult(requestId).send({ from: accounts[0] });
      setTxHash(tx.transactionHash);
      alert(`Minting successful! See transaction: https://sepolia.arbiscan.io/tx/${tx.transactionHash}`);
    } catch (error) {
      console.error("Error minting NFT:", error);
    }
  };

  const fetchTokenURI = async () => {
    if (!window.ethereum) return;

    const web3 = new Web3(window.ethereum);
    const contract = new web3.eth.Contract(ABI_TOKEN_URI, CONTRACT_ADDRESS_TOKEN_URI);

    try {
      const uri = await contract.methods.tokenURI(requestId).call();
      setTokenURI(uri);

      const decodedURI = JSON.parse(atob(uri.split(",")[1]));
      setImageSrc(decodedURI.image);
    } catch (error) {
      console.error("Error fetching token URI:", error);
    }
  };

  return (
    <div style={{ maxWidth: "600px", margin: "auto", padding: "20px" }}>
      <h2>AI NFT Minting DApp</h2>
      <input
        type="text"
        value={prompt}
        onChange={handlePromptChange}
        placeholder="Enter your prompt..."
        style={{ width: "100%", padding: "8px", marginBottom: "10px" }}
      />
      <button onClick={requestAIResult} style={{ padding: "10px", marginRight: "10px" }}>
        Request AI Result
      </button>
      <button onClick={mintNFT} style={{ padding: "10px", marginRight: "10px" }}>
        Mint NFT
      </button>
      <button onClick={fetchTokenURI} style={{ padding: "10px" }}>
        Fetch Token URI
      </button>

      {txHash && (
        <p>
          Transaction: <a href={`https://sepolia.arbiscan.io/tx/${txHash}`} target="_blank" rel="noopener noreferrer">{txHash}</a>
        </p>
      )}

      {tokenURI && (
        <div>
          <h3>Token Metadata:</h3>
          <pre>{tokenURI}</pre>
          {imageSrc && <iframe src={imageSrc} width="100%" height="300px" />}
        </div>
      )}
    </div>
  );
};

export default App;
